import React from "react";

const ResultTable = ({ data }) => {
  const confidence = (parseFloat(data.confidence) * 100).toFixed(2);

  return (
    <div className="mt-4">
      <table className="table-auto w-full">
        <thead>
          <tr>
            <th className="px-4 py-2 text-left text-white">Label</th>
            <th className="px-4 py-2 text-right text-white">Confidence</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td className="border px-4 py-2 text-white">{data.class}</td>
            <td className="border px-4 py-2 text-right text-white">
              {confidence}%
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default ResultTable;
